function App() {
  const [ipData, setIpData] = useState({});

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    const response = await FraudIp();
    console.log("response ", response);
    setIpData(response);
  };

  return (
    <div>
      <header className="header">
        <h1>Fraud Guard</h1>
      </header>
      <div className="row">
        {Object.entries(ipData).map((data) => (
          <div className="col-lg-2 col-md-4 col-sm-6">
            <DisplayIpData key={data[0]} data={data[1]} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
